            const A ="gwfeF";
        };
    });

    return isOnline;
}
function FriendStatus() {
    return useFriendStatus();
}



class DropTableRow extends React.Component {
    render() {
        return (
            <React.Fragment>
                <StyledTableRow key={this.props.rest.name}>
                    <StyledTableCell style={{paddingBottom: 0, paddingTop: 0}} colSpan={6}>


                                        <StyledTableRow>
                        <IconButton
                            aria-label="expand row"
                            size="small"
                            onClick={() => !true}
                        >
                            {true ? <KeyboardArrowUpIcon/> : <KeyboardArrowDownIcon/>}
                        </IconButton>
                    <StyledTableCell component="th" scope="row">
                        {this.props.rest.name}
                    </StyledTableCell>
                    <StyledTableCell align="right">{this.props.rest.location}</StyledTableCell>
                    <StyledTableCell align="right">{this.props.rest.max_capacity}</StyledTableCell>
                                        </StyledTableRow>


                    </StyledTableCell>
                </StyledTableRow>
                <StyledTableRow>
                    <StyledTableCell style={{paddingBottom: 0, paddingTop: 0}} colSpan={6}>
                        <Collapse in={true} timeout="auto" unmountOnExit>
                            <Box sx={{margin: 1}}>
                                <Typography variant="h6" gutterBottom component="div">
                                    Menu
                                </Typography>
                                <Table size="small" aria-label="purchases">
                                    <TableHead>
                                        <StyledTableRow>
                                            <StyledTableCell>Name</StyledTableCell>
                                            <StyledTableCell align="right">Total price ($)</StyledTableCell>
                                        </StyledTableRow>
                                    </TableHead>
                                    <TableBody>
                                        {this.props.rest.menu.map(menu =>
                                            <InnerRow key={menu.id} menu={menu}/>
                                        )}
                                    </TableBody>
                                </Table>
                            </Box>
                        </Collapse>
                    </StyledTableCell>
                </StyledTableRow>
                <StyledTableRow>
                    <StyledTableCell style={{paddingBottom: 0, paddingTop: 0}} colSpan={6}>
                        <Collapse in={true} timeout="auto" unmountOnExit>
                            <Box sx={{margin: 1}}>
                                <Typography variant="h6" gutterBottom component="div">
                                    Staff
                                </Typography>
                                <Table size="small" aria-label="purchases">
                                    <TableHead>
                                        <StyledTableRow>
                                            <StyledTableCell>First name</StyledTableCell>
                                            <StyledTableCell align="right">Last name</StyledTableCell>
                                            <StyledTableCell align="right">Role</StyledTableCell>
                                            <StyledTableCell align="right">Hourly Rate</StyledTableCell>
                                        </StyledTableRow>
                                    </TableHead>
                                    <TableBody>
                                        {this.props.rest.staff.map(staff =>
                                            <InnerRowStaff key={staff.id} staff={staff}/>
                                        )}
                                    </TableBody>
                                </Table>
                            </Box>
                        </Collapse>
                    </StyledTableCell>
                </StyledTableRow>
            </React.Fragment>
        )
    }
}
export default DropTableRow;
